import Link from 'next/link';

export default function Navbar() {
    return (
        <div className="nav">
            <ul className="main-nav">
                <li><Link href="/about" className="navbar">
                    <a title="About Page" >About Page</a>
                </Link></li>
                <li><Link href="/Donations" className="navbar">
                    <a title="Donations">Donations</a>
                </Link></li>
                <li><Link href="/contact" className="navbar">
                    <a title="Contact">Contact</a>
                </Link></li>
            </ul>

            <style jsx>{`
                .nav {
                    position: fixed;
                    top: 0px;
                    padding: 0 20px;
                    display: flex;
                    flex-direction: row;
                    flex-wrap: wrap;
                    width: 100%;
                    height: 100px;
                    align-items: center;
                    background-color: #1D50A2;
                    box-shadow: 0 10px 20px #1D50A2;
                }
                .main-nav {
                    padding: 10px 15px;
                    text-transform: uppercase;
                    text-align: center;
                    display: block;
                    text-decoration: none;
                }

            }
            `}</style>
        </div>

    )
}
